import React, { Component } from 'react';
import './App.css';
import ButtonCore from './buttonCore.js'

// {
//   "buttons": {
//     "multipleChoiceButton": {

//     },
//     "button2": {

//     },
//     "button3": {

//     }
//   }
// }

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0,
      randomButton: this.setRandomButton()
    }
  }

  dummyFunction(e) {
    this.setState({
      counter: this.state.counter + 1
    })

    e.preventDefault()
  }

  getRandomButton() {
    let types = ["multipleChoiceButton", "button2", "button3"]
    let type = types[Math.floor(Math.random() * 3)]
    return <ButtonCore 
      type = {type}
      onClick = {(e) => this.dummyFunction(e)}
    />

  }

  setRandomButton() {
    this.setState({
      randomButton: this.getRandomButton()
    })
  }


  render() {
    return (
      <div className="App">
        <div className="Button">
          {this.state.randomButton}
        </div>
      <div>{this.state.counter}</div>
      </div>
    );
  }
}

export default App;
